import back_image from '../images/back.png';
import React from 'react';
import './top.css';

export default function create_tpop() {
    return (
        <div className="top">
            <img src={back_image} alt="back" className="top-image" />
            <h1 className="top-title">水瀬いのり セッション会</h1>
        </div>
    );
}
